DO $$
BEGIN
    IF NOT EXISTS (
        SELECT 1
        FROM pg_type t
        JOIN pg_namespace n ON n.oid = t.typnamespace
        WHERE t.typname = 'action_type'
        AND n.nspname = 'public'
    ) THEN
        CREATE TYPE public.action_type AS ENUM
            ('warn', 'ban', 'kick', 'softban', 'timeout', 'unban', 'mute', 'unmute');
    END IF;
END$$;
